import React from 'react'
import { secondSection } from '../global/Data'

function About() {
    return (
        <section className='lg:h-[300px] py-12 px-20'>
            <div className="container mx-auto h-full relative items-center md:py-20">
                <div className="text-center xl:text-center">
                    <div className='grid grid-cols-3'>
                        {secondSection.map((item, idx) => {
                            return (
                                <div key={idx} className="flex flex-row space-x-6 py-8 px-8">
                                    <div><img src={item.icon} alt="" /></div>
                                    <div>
                                        <div>{item.title}</div>
                                        <div>{item.subtitle}</div>
                                    </div>
                                </div>
                            )
                        })}
                    </div>
                </div>
            </div>
        </section>
    )
}

export default About
